import React from 'react';

const Header = (props) => {
  return (
    <h1>{props.course}</h1>
  );
}

const Part = (props) => {
  return (
    <p>
      {props.part} {props.exercise}
    </p>
  );
}

const Content = (props) => {
  return (
    <div>
      <Part part={props.part.part1} exercise={props.exercises.exercises1}/>
      <Part part={props.part.part2} exercise={props.exercises.exercises2}/>
      <Part part={props.part.part3} exercise={props.exercises.exercises3}/>
    </div>
  );
}

const Total = (props) => {
  return (
    <p>Number of exercises {props.exercises.exercises1 + props.exercises.exercises2 + props.exercises.exercises3}</p>
  );
}

const App = () => {
  const course = 'Half Stack application development';
  const part = {part1: 'Fundamentals of React', 
                part2: 'Using props to pass data',
                part3: 'State of a component'
              };
  const exercises = {exercises1: 10,
                     exercises2: 7,
                     exercises3: 14
                    };

  return (
    <div>
      <Header course={course}/>
      <Content part={part} exercises={exercises}/> 
      <Total exercises={exercises}/>
    </div>
  )
};

export default App;
